import React from 'react';
import PropTypes from 'prop-types';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import CssBaseline from '@material-ui/core/CssBaseline';
import useScrollTrigger from '@material-ui/core/useScrollTrigger';
import Box from '@material-ui/core/Box';
import Container from '@material-ui/core/Container';
import Slide from '@material-ui/core/Slide';
import { createMuiTheme } from '@material-ui/core/styles';
import { ThemeProvider } from '@material-ui/styles';
const THEME = createMuiTheme({
  typography: {
  "  fontFamily": 'Work Sans',
  }
});
function HideOnScroll(props) {
  const { children, window } = props;
  // Note that you normally won't need to set the window ref as useScrollTrigger
  // will default to window.
  // This is only being set here because the demo is in an iframe.
  const trigger = useScrollTrigger({ target: window ? window() : undefined });

  return (
    <Slide appear={false} direction="down" in={!trigger}>
      {children}
    </Slide>
  );
}

HideOnScroll.propTypes = {
  children: PropTypes.element.isRequired,
  /**
   * Injected by the documentation to work in an iframe.
   * You won't need it on your project.
   */
  window: PropTypes.func,
};

export default function HideAppBar(props) {
  return (
    <ThemeProvider theme={THEME}>
    <div style={{background:'#222222',color:'#f5f5f5',height:'100vh'}}>
      <CssBaseline />
      <HideOnScroll {...props}>
        <AppBar style={{background:'#222222',color:'#f5f5f5'}}>
          <Toolbar>
            <Typography variant="h6">0.1 about me 0.2 Experince 0.3 Work 0.5 Project 0.4 Contact</Typography>
          </Toolbar>
        </AppBar>
      </HideOnScroll>
      <Toolbar />
      <Container >
        <Box my={2}>
            <Box fontSize={18} my={2}>
              Hi,My name is 
         </Box>
         <Box fontSize={36}>
              Jittanan J.
         </Box>
         <Box fontSize={36}>
              Jittanan Jackthreemongkol
         </Box>
         <Box fontSize={18}>
              I am
         </Box>
        </Box>
      </Container>
      </div>
      </ThemeProvider>
  );
}
